import React from 'react';
import styled from 'styled-components'


const Main = styled.div`
    height: 500px;
	width: 100%;
	color: red,
	overflow: none;
`;

const Text404Div = styled.div`
    margin: auto;
    font-size: 48px;
    color: rgba(255, 89, 89, 1);
`;

const NoMatch = () => {
   return (
        <Main>
            <Text404Div>
                Page Not Found
            </Text404Div>
        </Main>	
	);

}


export default NoMatch;
